import React from "react"

function Gamebody (props) {

    return (
        <div id="gameBody"> 
          {
            props.imageArray.map(item => (
            <div className="card medium" key={item[0]} >
              <img 
                src={"./images/" + item[1]} 
                alt="Redshirt" 
                width="100" 
                id={item[0]} 
                className="guess" 
                onClick={() => props.catchAnswer(item[0])}
              />
            </div>
            ))
          }
        </div>
    )
}

export default Gamebody;
